INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 118501, 118501, 0, 0, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 1, 37, "2030/12/31 15:00:00", 37, 118501, 0, 2, "かりん", 1, "カリン", "2021/10/19 12:00:00", 450, 2.0, 118501, 0, 0, 787);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 118601, 118601, 0, 0, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 3, 0, "2030/12/31 15:00:00", 0, 118601, 0, 2, "ねびあ", 1, "ネビア", "2024/08/10 21:00:00", 450, 2.0, 118601, 0, 0, 826);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 119001, 119001, 0, 0, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 3, 7, "2030/12/31 15:00:00", 7, 119001, 0, 2, "いお", 0, "イオ（ノワール）", "2021/11/03 19:00:00", 450, 2.27, 119001, 0, 15, 714);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 119101, 119101, 0, 0, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 3, 26, "2030/12/31 15:00:00", 7, 119101, 0, 2, "くうか", 0, "クウカ（ノワール）", "2021/11/16 12:00:00", 450, 2.545, 119101, 0, 12, 143);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 119201, 119201, 0, 0, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 1, 6, "2030/12/31 15:00:00", 6, 119201, 0, 1, "まひる", 1, "マヒル（クリスマス）", "2023/09/19 15:00:00", 450, 2.19, 119201, 0, 5, 397);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 119301, 119301, 0, 0, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 3, 8, "2030/12/31 15:00:00", 8, 119301, 0, 1, "りの", 0, "リノ（クリスマス）", "2021/12/22 12:00:00", 450, 1.97, 119301, 0, 6, 762);
