INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 120001, 120001, 0, 0, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 3, 5, "2024/03/28 11:59:59", 5, 120001, 0, 1, "しずる", 1, "シズル（ノワール）", "2024/03/22 12:00:00", 450, 2.375, 120001, 0, 6, 190);
