INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 120701, 120701, 0, 0, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 3, 22, "2024/01/31 11:59:59", 4, 120701, 0, 1, "しぇふぃ", 1, "シェフィ（ニューイヤー）", "2024/01/26 12:00:00", 450, 1.84, 120701, 0, 1, 283);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 120801, 120801, 0, 0, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 1, 22, "2030/12/31 15:00:00", 4, 120801, 0, 1, "るか", 1, "ルカ（ニューイヤー）", "2023/10/16 15:00:00", 450, 1.3, 120801, 0, 2, 193);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 120901, 120901, 0, 0, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 3, 38, "2024/01/31 11:59:59", 3, 120901, 0, 2, "いりや", 1, "イリヤ（ニューイヤー）", "2024/01/26 12:00:00", 450, 1.425, 120901, 0, 12, 424);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 121001, 121001, 0, 0, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 3, 41, "2024/02/29 11:59:59", 5, 121001, 0, 1, "ぺこりーぬ", 1, "ペコリーヌ（オーバーロード）", "2024/02/22 12:00:00", 450, 2.25, 121001, 0, 1, 164);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 121101, 121101, 0, 0, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 3, 42, "2024/02/29 11:59:59", 7, 121101, 0, 2, "きゃる", 1, "キャル（オーバーロード）", "2024/02/22 12:00:00", 450, 2.07, 121101, 0, 1, 588);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 121201, 121201, 0, 0, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 1, 40, "2030/12/31 15:00:00", 4, 121201, 0, 1, "らびりすた", 1, "ラビリスタ（オーバーロード）", "2023/11/16 15:00:00", 450, 1.55, 121201, 0, 6, 260);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 121301, 121301, 0, 0, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 3, 3, "2030/12/31 15:00:00", 3, 121301, 0, 1, "くるみ", 0, "クルミ（ステージ）", "2022/03/03 19:00:00", 450, 1.9, 121301, 0, 3, 731);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 121401, 121401, 0, 0, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 3, 7, "2030/12/31 15:00:00", 7, 121401, 0, 2, "みさき", 0, "ミサキ（ステージ）", "2022/03/15 15:00:00", 450, 2.27, 121401, 0, 15, 742);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 121501, 121501, 0, 0, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 3, 6, "2024/04/15 14:59:59", 6, 121501, 0, 1, "あゆみ", 1, "アユミ（怪盗）", "2024/04/12 12:00:00", 450, 2.0, 121501, 0, 12, 590);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 121601, 121601, 0, 0, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 3, 3, "2030/12/31 15:00:00", 3, 121601, 0, 1, "いのり", 0, "イノリ（怪盗）", "2022/04/15 15:00:00", 450, 1.425, 121601, 0, 17, 292);
