INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 130701, 130701, 0, 0, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 3, 7, "2024/05/15 14:59:59", 7, 130701, 0, 2, "きょうか", 1, "キョウカ（スプリング）", "2024/05/03 19:00:00", 450, 1.92, 130701, 0, 0, 563);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 130801, 130801, 0, 0, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 3, 7, "2030/12/31 15:00:00", 7, 130801, 0, 2, "すずめ", 0, "スズメ（スプリング）", "2024/05/15 15:00:00", 450, 1.84, 130801, 0, 0, 558);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 130901, 130901, 0, 0, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 3, 7, "2030/12/31 15:00:00", 7, 130901, 0, 2, "くるる", 0, "クルル", "2024/06/15 15:00:00", 450, 2.09, 130901, 0, 0, 440);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 131001, 131001, 0, 0, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 3, 7, "2024/06/10 11:59:59", 7, 131001, 0, 2, "まほ", 1, "マホ（ドリームパーク）", "2024/05/31 12:00:00", 450, 1.84, 131001, 0, 0, 702);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 131101, 131101, 0, 0, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 3, 52, "2030/12/31 15:00:00", 2, 131101, 0, 1, "ねあ", 0, "ネア（サマー）", "2024/06/30 12:00:00", 450, 2.09, 131101, 0, 0, 165);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 131201, 131201, 0, 0, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 3, 35, "2024/07/15 15:00:00", 35, 131201, 0, 2, "みそら", 1, "ミソラ（サマー）", "2024/07/03 19:00:00", 450, 2.09, 131201, 0, 0, 753);
