INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 131601, 131601, 0, 0, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 3, 4, "2024/07/26 11:59:59", 4, 131601, 0, 1, "りり", 1, "リリ（サマー）", "2024/07/15 15:00:00", 450, 1.92, 131601, 0, 0, 399);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 131701, 131701, 0, 0, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 3, 53, "2024/08/12 11:59:59", 44, 131701, 0, 2, "あめす", 1, "アメス（サマー）", "2024/07/31 12:00:00", 450, 1.92, 131701, 0, 0, 743);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 131801, 131801, 0, 0, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 3, 21, "2030/12/31 15:00:00", 7, 131801, 0, 2, "ほまれ", 0, "ホマレ（サマー）", "2024/08/15 15:00:00", 450, 2.09, 131801, 0, 0, 709);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 131901, 131901, 0, 0, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 1, 23, "2030/12/31 15:00:00", 7, 131901, 1, 2, "えみりあ", 1, "エミリア（サマー）", "2024/08/31 12:00:00", 450, 2.09, 131901, 0, 0, 725);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 132001, 132001, 0, 0, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 3, 21, "2024/09/25 11:59:59", 7, 132001, 0, 2, "えきどな", 1, "エキドナ（サマー）", "2024/09/13 12:00:00", 450, 2.09, 132001, 0, 0, 775);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 132101, 132101, 0, 0, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 3, 24, "2024/09/13 11:59:59", 13, 132101, 0, 1, "れむ", 1, "レム（サマー）", "2024/08/31 12:00:00", 450, 2.09, 132101, 0, 0, 146);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 132201, 132201, 0, 0, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 3, 7, "2024/10/10 11:59:59", 7, 132201, 0, 2, "のぞみ", 1, "ノゾミ（アルケミスト）", "2024/09/30 12:00:00", 450, 1.84, 132201, 0, 0, 721);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 170101, 105701, 0, 0, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 3, 34, "2030/12/31 15:00:00", 34, 170101, 0, 1, "じーた", 0, "ジータ", "2015/04/01 15:00:00", 450, 1.965, 170101, 0, 4, 245);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 180101, 180101, 0, 0, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 3, 0, "2024/08/26 18:59:59", 0, 180101, 0, 1, "ひより", 1, "ヒヨリ（プリンセス）", "2024/08/23 12:00:00", 450, 1.62, 180101, 0, 7, 199);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 180201, 180201, 0, 0, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 3, 0, "2024/08/26 18:59:59", 0, 180201, 0, 2, "ゆい", 1, "ユイ（プリンセス）", "2024/08/23 12:00:00", 450, 1.92, 180201, 0, 1, 767);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 180301, 180301, 0, 0, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 3, 0, "2024/08/26 18:59:59", 0, 180301, 0, 1, "れい", 1, "レイ（プリンセス）", "2024/08/23 12:00:00", 450, 1.965, 180301, 0, 7, 377);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 180401, 180401, 0, 0, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 3, 0, "2024/08/26 18:59:59", 0, 180401, 0, 1, "ぺこりーぬ", 1, "ペコリーヌ（プリンセス）", "2024/08/23 12:00:00", 450, 1.965, 180401, 0, 1, 155);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 180501, 180501, 0, 0, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 3, 0, "2024/08/26 18:59:59", 0, 180501, 0, 1, "こっころ", 1, "コッコロ（プリンセス）", "2024/08/23 12:00:00", 450, 2.14, 180501, 0, 1, 555);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 180601, 180601, 0, 0, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 3, 0, "2024/08/26 18:59:59", 0, 180601, 0, 2, "きゃる", 1, "キャル（プリンセス）", "2024/08/23 12:00:00", 450, 1.92, 180601, 0, 1, 747);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 180701, 180701, 0, 0, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 3, 0, "2024/08/26 18:59:59", 0, 180701, 0, 1, "はつねしおり", 1, "ハツネ＆シオリ", "2024/08/23 12:00:00", 450, 1.75, 180701, 0, 1, 732);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 180801, 180801, 0, 0, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 3, 0, "2024/08/26 18:59:59", 0, 180801, 0, 1, "みそぎみみきょうか", 1, "ミソギ＆ミミ＆キョウカ", "2024/08/23 12:00:00", 450, 1.5, 180801, 0, 1, 465);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 180901, 180901, 0, 0, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 3, 0, "2024/08/26 18:59:59", 0, 180901, 0, 1, "あきのされん", 1, "アキノ＆サレン", "2024/08/23 12:00:00", 450, 2.09, 180901, 0, 1, 421);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 181001, 181001, 0, 0, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 3, 0, "2024/08/26 18:59:59", 0, 181001, 0, 2, "あんぐれあ", 1, "アン＆グレア", "2024/08/23 12:00:00", 450, 2.09, 181001, 0, 1, 577);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 181101, 181101, 0, 0, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 3, 0, "2024/08/26 18:59:59", 0, 181101, 0, 1, "しずるりの", 1, "シズル＆リノ", "2024/08/23 12:00:00", 450, 1.92, 181101, 0, 1, 551);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 181201, 181201, 0, 0, "【物理】中衛で新たな力と共に再廻する姫装の氷竜少女。\n環境効果【絶氷】でクリティカルダメージを高め、火力と\n手数を併せ持つ剣技で、再び共に歩むため道を切り開く。", 3, 0, "2024/08/26 18:59:59", 0, 181201, 0, 1, "しぇふぃ", 1, "シェフィ（プリンセス）", "2024/08/23 12:00:00", 450, 1.92, 181201, 0, 1, 368);
