INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 191301, 191301, 0, 0, "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 1, 6, "2030/12/31 15:00:00", 6, 191301, 0, 1, "かずまさ", 1, "カズマサ", "2015/04/01 15:00:00", 450, 2.22, 191301, 0, 0, 850);
