INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 0, 191501, 100101, 0, 0, "残されたわずかな時間で宿題を終わらせんとする\nルーセント学院の生徒。楽しい夏休みの思い出を\n守るため、山積みの宿題へと立ち向かう。", 0, 0, "2030/12/31 15:00:00", 0, 191501, 0, 0, "しゅじんこう", 0, "主人公", "2015/04/01 15:00:00", 150, 0.0, 100101, 0, 0, 1600);
